import React from 'react';
import CardBoard from "./components/cardBoard";

function App() {
  return (
    <div className="App">
        <div className='container-fluid'>
          <div className="row justify-content-center align-content-center-center">
              <CardBoard/>
          </div>
        </div>

      {/* /.row */}
    </div>
  );
}

export default App;
